from string import Template
from SPARQLWrapper import SPARQLWrapper2, JSON
import urllib2

proxy = urllib2.ProxyHandler({'http': 'gateway.ad.renci.org:8080'})
opener = urllib2.build_opener(proxy)
urllib2.install_opener(opener)

blazegraph_uri = "http://stars-blazegraph.renci.org/bigdata/sparql"
blazegraph = SPARQLWrapper2 (blazegraph_uri)

class Query (object):

    def __init__(self):
        self.provenance = TranslatorProvenance ()

    @provenance()
    def get_exposure (self, start, end):
        import requests
        exposure = 'http://bdtgis.renci.org:9090/v1/exposures/pm25/scores?start_date=1985-04-12&end_date=2018-04-13&exposure_point=35.720278%2C-79.176389&temporal_resolution=day&score_type=7dayrisk'
        r = requests.get (exposure)
        #print ('response: {0} code: {1}'.format (r.json(), r.status_code))

        return requests.post (
            "https://exposures.renci.org/v1/getExposureScore",
            data = {
              "etime": "1985-04-12",
              "exposure": "pm25",
              "loc": "35.720278,-79.176389,Sa,35.731944,-78.852778,Su",
              "stime": "1985-04-12",
              "tres": "string",
              "tscore": "string"
            }).json ()

    @provenance()
    def query_sparql (self, query, service=blazegraph):
        service.setQuery (query)
        service.setReturnFormat (JSON)
        return service.query().convert ()
